// Login.js

import { useNavigate } from 'react-router-dom';

function Login() {
  const navigate = useNavigate();

  const handleLogin = () => {
    // Simulación de inicio de sesión exitoso
    // Normalmente aquí se realizaría la lógica de autenticación

    // Redirigir a la página principal (Home) después del inicio de sesión
    navigate('/home');
  };

  return (
    <div>
      <h2>Login Page</h2>
      <button onClick={handleLogin}>Login</button>
    </div>
  );
}

export default Login;
